import React from "react";

import '../Css/BotonColRND.css';

function BotonColRND({colorRND, texto}) {
  return(
    <div className="texto-color-random">
      <label
        style={color}>{texto}</label>
      <button
        className="btnColorRND"
        onClick={colorRND}>
        Cambiar Color
      </button>
    </div>
  );
  
};

export default BotonColRND;
